// SPDX-License-Identifier: MIT
pragma solidity^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./NativeMetaTransaction.sol";
import "./Ownable.sol";


contract BEPMotoNFT is NativeMetaTransaction, Ownable, ERC721URIStorage{

  constructor(string memory _name, string memory _symbol) ERC721(_name, _symbol) {
    _initializeEIP712('Moto Network NFT', '1');
    addMinter(owner());
    addAdmin(owner());
  }

  event MinterAdded(address indexed newMinter);
  event MinterRemoved(address indexed oldMinter);
  event AdminAdded(address indexed newAdmin);
  event AdminRemoved(address indexed oldAdmin);
  event NFTMinted(address indexed owner, uint256 indexed tokenID);
  event NFTBurned(address indexed burner, uint256 indexed tokenID);
  event NewFeeSet(uint256 indexed feeAmount,address adjuster);

  //test events
  /*
  event SignatureVerification(bytes32 indexed r, bytes32 indexed s, uint8 indexed v);
  event NFTEntered(NFT indexed nft);
  event TypesHashed(bytes32 indexed DomainSeperator,bytes32 indexed NFTTypeHash );
  event 
*/
  modifier onlyMinters{
    require(minters[_msgSender()]==true,"can not mint because not approved minter");
    _;
  }

  modifier onlyAdmins{
    require(admins[_msgSender()]==true,"can not perform action because not admin");
    _;
  }

  struct NFT{
    string name;
    uint256 network;
    address beneficiary;
    bytes32 contentHash;
    uint256 tokenId;
  }
  bytes32 constant NFT_TYPEHASH = keccak256("NFT(string name,uint256 network,address beneficiary,bytes32 contentHash,uint256 tokenId)");

  mapping(address => bool) private admins;
  mapping(address => bool) private minters;
  mapping( uint256 => NFT) private NFTmetaData;
  mapping(bytes32 => bool) private existingHash;

  uint256 private _fee;


  function adminMint(string calldata name, uint256 network, address beneficiary, bytes32 contentHash, uint256 tokenId) public onlyMinters{
    NFT memory nft = NFT(name,network, beneficiary, contentHash, tokenId);
    createNFT(nft);
  }


  function userMint(string calldata name, uint256 network, address beneficiary, bytes32 contentHash, uint256 tokenId, bytes32 r, bytes32 s, uint8 v) payable public{
    require(msg.value >= _fee, "required minimum fee not paid");
    NFT memory nft = NFT(name,network, beneficiary, contentHash, tokenId);
    bool valid = true; //verifySignature(nft,r,s,v);
    if(valid){
      createNFT(nft);
    }
    else{
      revert("Signature Verification Failed");
    }
  }


  function createNFT(NFT memory nft) private {
    verifyUnique(nft);
    super._mint(nft.beneficiary, nft.tokenId);
    NFTmetaData[nft.tokenId] = nft;
    existingHash[nft.contentHash] = true;
    emit NFTMinted(nft.beneficiary, nft.tokenId);
  }


  function verifyUnique(NFT memory nft)internal view returns (bool){
    require(existingHash[nft.contentHash]==false,"an NFT already represents this file");
    require(_exists(nft.tokenId)==false,"someone already owns this NFT");
  }


  function burn(uint256 _tokenId) public {
    require(ownerOf(_tokenId)==_msgSender(),"NFTs can only be burned by their respective owners");
    super._burn(_tokenId);
    NFT storage nft = NFTmetaData[_tokenId];
    existingHash[nft.contentHash]=false;
    delete NFTmetaData[_tokenId];
    emit NFTBurned(_msgSender(),_tokenId);
  }


  function setTokenURI(uint256 _tokenId, string calldata _uri) public onlyAdmins{
    super._setTokenURI(_tokenId, _uri);
  }



  function getNFTinfo(uint256 tokenID) public view returns(NFT memory){
    return NFTmetaData[tokenID];
  }

  function setFee(uint256 fee_) public onlyAdmins{
    _fee = fee_;
    emit NewFeeSet(fee_,_msgSender());
  }


  function getFee() public returns(uint256){
    return _fee;
  }


  function addMinter(address newMinter) public onlyOwner{
    require(newMinter != address(0), "Minter can not be zero address.");
    minters[newMinter] = true;
    emit MinterAdded(newMinter);
  }


  function removeMinter(address oldMinter) public onlyOwner{
    require(oldMinter!=owner(), "Can not remove Owner");
    minters[oldMinter] = false;
    emit MinterRemoved(oldMinter);
  }


  function addAdmin(address newAdmin) public onlyOwner{
    require(newAdmin!=address(0),"cant be zero address");
    admins[newAdmin] = true;
    emit AdminAdded(newAdmin);
  }


  function removeAdmin(address oldAdmin) public onlyOwner{
    require(oldAdmin!=owner(),"can not remove owner");
    admins[oldAdmin] = false;
    emit AdminRemoved(oldAdmin);
  }


  function hashVerfiedNFT(NFT memory nft) private returns(bytes32){
    return keccak256(abi.encodePacked(
      NFT_TYPEHASH,
      nft.name,//keccak256(bytes(nft.name)),
      nft.network,
      nft.beneficiary,
      nft.contentHash,
      nft.tokenId
    ));
  }



  function verifySignature(NFT memory nft, bytes32 r,bytes32 s,uint8 v) private returns (bool){
    bytes32 digest = keccak256(abi.encodePacked(
      "\x19\x01",
      DOMAIN_SEPERATOR,
      hashVerfiedNFT(nft)
    ));

    return ecrecover(digest,v,r,s) == _msgSender();
  }


  function withdraw(uint256 amount) external onlyOwner{
    address payable payee = payable(owner());
    payee.transfer(amount);
  }



}
